import styled from "styled-components";
import Wheel from "./wheel";

const Roulette = () => {

    let Title = styled.h1`
        font-size: 3rem;
        letter-spacing: 1rem;
    `
    return(
            <center>
            <Title>ROULETTE</Title>
            <Wheel/>
            <button>Roll</button>
            </center>

    )
}

export default Roulette;
